<script>
import Headroom from 'headroom.js'
import { gsap } from 'gsap/all'

export default {
  data () {
    return {
      pageLoaded: true
    }
  },
  props: {
    // msg: String
  },
  methods: {
    animPrel: function () {
      const tl = gsap.timeline()
      tl.to('.prel__c_1', { yPercent: -90, duration: 2, ease: 'power1.out' }, '>')
      tl.to('.prel__c_1', { yPercent: 0, duration: 2, delay: 1, ease: 'power1.out' })
      tl.to('.prel__c_2', { yPercent: -90, duration: 2, delay: 0.2, ease: 'power1.out' }, 0)
      tl.to('.prel__c_2', { yPercent: 0, duration: 2, delay: 1, ease: 'power1.out' }, '>')
      tl.to('.prel__c_3', { yPercent: -90, duration: 2, delay: 0.4, ease: 'power1.out' }, 0)
      tl.to('.prel__c_3', { yPercent: 0, duration: 2, delay: 1, ease: 'power1.out' }, '>')

      tl.pause()
      tl.play()
      this.pageLoaded = false
      const prelInt = setInterval(() => {
        if (this.pageLoaded) {
          clearInterval(prelInt)
          const tlOut = gsap.timeline()
          tlOut.to('.mFirst', { opacity: '0', duration: 0 })
          tlOut.to('.prel__c_1', { xPercent: 100, duration: 0.6 })
          tlOut.to('.prel__c_3', { xPercent: -100, duration: 0.6 }, 0)
          tlOut.to('.prel__c_1', { opacity: '0', duration: 0.1 }, '>')
          tlOut.to('.prel__c_3', { opacity: '0', duration: 0.1 }, '<')
          tlOut.to('.prel__svg', { fill: '#202020', duration: 0.6 })
          tlOut.to('.prel__left', { xPercent: -100, duration: 0.5, ease: 'power1.in' }, '>')
          tlOut.to('.prel__right', { xPercent: 100, duration: 0.5, ease: 'power1.in' }, '<')
          tlOut.to('.prel__top', { yPercent: -100, duration: 0.6, ease: 'power1.in' }, '>')
          tlOut.to('.prel__bottom', { yPercent: 100, duration: 0.6, ease: 'power1.in' }, '<')
          tlOut.to('.prel__c_2', { opacity: '0', duration: 0.5 }, '<')
          if (this.$route.path === '/') { tlOut.to('.mFirst', { opacity: '1', duration: 0.5 }) }
          tlOut.add(() => { this.$store.state.prel = true })
          // this.$store.state.prel = true
        } else {
          tl.restart()
        }
      }, 6000)
      setTimeout(() => {
        this.pageLoaded = true
      }, 2000)
    }
  },
  mounted () {
    const header = document.querySelectorAll('.header')
    header.forEach(el => {
      new Headroom(el).init()
    })
    // console.log()
    if (!this.$store.state.prel) { this.animPrel() }
  }
  // unmounted () {
  //   console.log('Пока')
  // }
}
</script>

